import React from 'react';

function About() {
  return (
    <div>
      <h1>신혜원</h1>
      <h2>Shin Hyewon</h2>
      <p>서울대학교 디자인과 시각디자인전공 & 연합전공 정보문화학
        <br></br>데이터를 활용한 디자인에 관심이 많습니다. 서울에서 프로덕트 디자인을 공부하고 있습니다. 
      </p>
    </div>
  );
}

export default About;
